--  Create Part table RDIMBEH

CREATE TABLE RDIMBEH
(P_NUMBER	VARCHAR2(6)	NOT NULL,
 CORE		VARCHAR2(32),
 INHEAD		VARCHAR2(17),
 OUTHEAD	VARCHAR2(17),
 INCON		VARCHAR2(14),
 OUCON		VARCHAR2(14),
 TMOUNT		VARCHAR2(24),
 OILCOOL	VARCHAR2(10),
 PRICE		NUMBER(8, 2),
 AMOUNT		NUMBER(10),
 PRIMARY KEY	(P_NUMBER));
 

